;; **
;;; Some test-data
;; **

;; **
;;; ## Basic Line-Plot
;; **

;; @@
(def line-plot-data {:x (range 1 101)
                     :y (take 100 (repeatedly #(rand 100)))})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;icy-abyss/line-plot-data</span>","value":"#'icy-abyss/line-plot-data"}
;; <=

;; @@
(gg4clj/view
  [[:<- :d (gg4clj/data-frame line-plot-data)]
   (gg4clj/r+
     [:ggplot :d [:aes :x :y]]
     [:geom_line {:color "steelblue"}]
     [:geom_point {:color "steelblue"}]
     [:xlab "X Axis"]
     [:ylab "Y Axis"]
     [:ggtitle "Example Title"])]
  {:width 6
   :height 4})
;; @@
